import React from "react";
import Link from "./Link";

export default function LinkList() {
    return (
        <section className="w-100">
            <div className="container mx-auto p-6 flex flex-col gap-6">
                <Link 
                    title="GitHub" 
                    link="https://github.com/wesleybertipaglia"
                />
            </div>
        </section>
    )
}
